import "./App.css";

import NavBar from './Components/NavBar'


function App() {
  return (
    <div>
      <h1> Tienda </h1>
       <NavBar/>
       <section>
          <figure className="card">
            <img src='./Components/images/' ></img>
          </figure>
       </section>
    </div>
  );
}

export default App;
